import React from 'react';
import ReactPlayer from 'react-player';
import './BTS.css';

const BTSYoutube = () => (
        <div className="Player">
            <ReactPlayer
            url="https://youtu.be/S8GpX3SAeig?list=PLsWOEapDJOmbs_Dm_rHar4D8htMOPLJvF"
            controls="on"
            width="650px"
            height="365.625px"
            volume="0.5" />
        </div>
);

export default BTSYoutube;
